import React from 'react'
import BoardRow from './BoardRow'

const Board = (props) => {
    const { cellValues } = props
    const nineArray = [1, 2, 3, 4, 5, 6, 7, 8, 9]
    console.log(cellValues)

    return (
        <div>
            <table>
                {nineArray.map((number) => {
                    return (
                        <BoardRow 
                        cellValues={cellValues}
                        key={number}
                        />
                    )
                })}
            </table>
        </div>

    )
}

export default Board
